# 2.2 Private quantiles 

Of course, a private boxplot relies on differentially private quantiles. The proposed private boxplot relies on the unbounded algorithm of Durfee (2023) and the JointExp algorithm of Gillenwater et al. (2021). These algorithms are the main focus of our theoretical exposition. However, the PrivateQuantile is a special case of JointExp and so our results also apply to PrivateQuantile. In addition, combining our results with those of Kaplan et al. (2022) allows our results to also hold for ApproxQuantile. We do, however, consider the performance of the naive boxplot constructed from all three of these algorithms in our simulation study, see Section 5 .

